import React from "react";

import './Home.css'
const Home = ({ name }) => {

    if (name !== "bhavik") {
        throw new Error("something went wrong!!")
    }

    return (
        <div className="maindiv">
            <header className="header">
                <div className="icon">
                    <i className="fa-duotone fa-arrow-left"></i>
                </div>
                <div className="para">
                    <p>shopping cart :</p>
                </div>

            </header>

        </div>
    )
}
export default Home
